import React, { useState } from "react";
import { Card, CardContent } from "./components/ui/Card";
import { Button } from "./components/ui/Button";
import { motion } from "framer-motion";

// ContactForm component inside the same file for convenience
function ContactForm() {
  const [form, setForm] = useState({ name: "", email: "", message: "" });
  const [submitted, setSubmitted] = useState(false);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Form submitted:", form);
    setSubmitted(true);
    setForm({ name: "", email: "", message: "" });
  };

  return (
    <section className="max-w-3xl mx-auto mt-16 p-6 bg-white bg-opacity-90 rounded-lg shadow-md">
      <h3 className="text-2xl font-semibold mb-6 text-center">Contact Us</h3>

      {submitted ? (
        <p className="text-green-600 text-center font-medium">
          Thank you for reaching out! We’ll get back to you shortly.
        </p>
      ) : (
        <form onSubmit={handleSubmit} className="space-y-6">
          <div>
            <label htmlFor="name" className="block mb-2 font-medium">
              Name
            </label>
            <input
              type="text"
              id="name"
              name="name"
              value={form.name}
              onChange={handleChange}
              required
              className="w-full border border-gray-300 rounded-md p-2 focus:outline-none focus:ring-2 focus:ring-indigo-500"
            />
          </div>

          <div>
            <label htmlFor="email" className="block mb-2 font-medium">
              Email
            </label>
            <input
              type="email"
              id="email"
              name="email"
              value={form.email}
              onChange={handleChange}
              required
              className="w-full border border-gray-300 rounded-md p-2 focus:outline-none focus:ring-2 focus:ring-indigo-500"
            />
          </div>

          <div>
            <label htmlFor="message" className="block mb-2 font-medium">
              Message
            </label>
            <textarea
              id="message"
              name="message"
              value={form.message}
              onChange={handleChange}
              rows="5"
              required
              className="w-full border border-gray-300 rounded-md p-2 focus:outline-none focus:ring-2 focus:ring-indigo-500"
            />
          </div>

          <div className="text-center">
            <button
              type="submit"
              className="bg-indigo-600 text-white px-6 py-3 rounded-xl hover:bg-indigo-700 transition"
            >
              Send Message
            </button>
          </div>
        </form>
      )}
    </section>
  );
}

export default function Home() {
  return (
    <div
      className="min-h-screen bg-cover bg-center text-gray-800 p-6"
      style={{
        backgroundImage:
          "url('https://images.unsplash.com/photo-1556761175-4b46a572b786?auto=format&fit=crop&w=1470&q=80')",
      }}
    >
      <div
        className="bg-white/80 backdrop-blur-sm rounded-xl max-w-7xl mx-auto p-10 shadow-lg max-h-[700px] overflow-auto my-10"
        style={{ backdropFilter: "blur(12px)" }}
      >
        <header className="text-center mb-12">
          <h1 className="text-4xl font-bold tracking-tight mb-4">
            Alucentra Consulting
          </h1>
          <p className="text-lg text-gray-700 max-w-xl mx-auto whitespace-nowrap">
            Illuminating transformation through clarity, insight, and operational
            excellence.
          </p>
        </header>

        <main className="grid grid-cols-1 md:grid-cols-3 gap-4 max-w-5xl mx-auto">
          {[
            {
              title: "Strategy & Transformation",
              desc: "Helping organizations navigate change with clarity and purpose.",
            },
            {
              title: "Process Design",
              desc: "Designing systems that scale, simplify, and support innovation.",
            },
            {
              title: "Change Management",
              desc: "Enabling people, teams, and culture to adapt and thrive.",
            },
          ].map(({ title, desc }) => (
            <motion.div key={title} whileHover={{ scale: 1.03 }}>
              <Card>
                <CardContent>
                  <h2 className="text-xl font-semibold mb-2">{title}</h2>
                  <p className="text-gray-600">{desc}</p>
                </CardContent>
              </Card>
            </motion.div>
          ))}
        </main>

        <section className="max-w-4xl mx-auto mt-16 text-center">
          <h3 className="text-2xl font-semibold mb-4">Ready to Illuminate Change?</h3>
          <p className="text-gray-600 mb-6">
            Let’s talk about how Alucentra can help you navigate complex transformation challenges.
          </p>
          <Button>Contact Us</Button>
        </section>

        {/* Contact form added here */}
        <ContactForm />
      </div>
    </div>
  );
}
